import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


class Carousel extends Component {
  render() {
    const settings = {
      className: "slides",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500,
      dots: true,
      arrows: true
    };
    return (
      <div>
        <Slider {...settings}>
          <div>
              <h3>slide 1</h3>
          </div>
          <div>
              <h3>slide 2</h3>
          </div>
          <div>
              <h3>slide 3</h3>
          </div>

        </Slider>
      </div>
    );
  }
}

export default Carousel;
